package com.bft.bo;

public class Note {

	private String a;
	private String b;
	
	
	public Note() {
		super();
		// TODO Auto-generated constructor stub
	}
	public Note(String a, String b) {
		super();
		this.a = a;
		this.b = b;
	}
	public String getA() {
		return a;
	}
	public void setA(String a) {
		this.a = a;
	}
	public String getB() {
		return b;
	}
	public void setB(String b) {
		this.b = b;
	}
	
	
	
}
